import { useCallback } from "react";
import "./PortfolioCard.css";

const PortfolioCard = () => {
  const onContactTouchClick1 = useCallback(() => {
    const aboutElement = document.getElementById("about-me"); // ระบุ ID ของส่วน "About" ใน Content.js
    if (aboutElement) {
      aboutElement.scrollIntoView({ behavior: "smooth" });
    }
  }, []);

  const onContactTouchClick2 = useCallback(() => {
    const contactElement = document.getElementById("contact-section"); // ระบุ ID ของส่วน "Contact" ใน Content.js
    if (contactElement) {
      contactElement.scrollIntoView({ behavior: "smooth" });
    }
  }, []);

  return (
    <div className="nav2">
      <b className="portfolio">Portfolio</b>
      <div className="about-parent">
  <b className="about4" onClick={onContactTouchClick1}>
    about
  </b>
  <b className="contact3"  onClick={onContactTouchClick2}>
    contact
  </b>
  <b className="get-in-touch1"  >
    get in touch
  </b>
      </div>
    </div>
  );
};

export default PortfolioCard;
